import React from 'react';
import styles from '../components/box.module.css';
import { Link } from 'react-router-dom';
function Box(props) {


  return(

      <span className={styles.box}> 

      <Link></Link>
       <p>
        {props.text}
       </p>

      </span>

  );
}

export default Box;
